import { Card } from 'react-bootstrap';
import MyStyle from '../styles/colorStyle';

const Footer = () => (
    <dev>
        <Card style={MyStyle.col_background}>
            <Card.Body>
                <Card.Text className="text-center footer_txt">
                    Copyright@ 2020
                <span> Muhalik </span>
                    - Online Shopping Website
            </Card.Text>
            </Card.Body>
        </Card>
        <style jsx>{`
            dev {
                position: absolute;
                left: 0;
                bottom: 0; 
                right: 0;
            }
            .footer_txt{
                color: red;
                font-size: 2px;
            }
            span {
                font-size: large;
                font-weight: bold;
            }
        `}</style>
    </dev>
)

export default Footer;
